    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t th\u00f4ng b\u00e1o x\u00e1c nh\u1eadn \u0111\u1ebfn {new_email_address}. Nh\u1ea5p v\u00e0o li\u00ean k\u1ebft trong th\u00f4ng b\u00e1o \u0111\u00f3 \u0111\u1ec3 c\u1eadp nh\u1eadt \u0111\u1ecba ch\u1ec9 email c\u1ee7a b\u1ea1n.", 
    "We've sent a message to {email_address}. Click the link in the message to reset your password.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t th\u00f4ng b\u00e1o \u0111\u1ebfn {emaili_address}. B\u1ea5m v\u00e0o li\u00ean k\u1ebft trong th\u00f4ng b\u00e1o \u0111\u1ec3 \u0111\u1eb7t l\u1ea1i m\u1eadt kh\u1ea9u.", 
