    "You must be over 13 to share a full profile. If you are over 13, make sure that you have specified a birth year on the {account_settings_page_link}": "B\u1ea1n ph\u1ea3i tr\u00ean 13 tu\u1ed5i \u0111\u1ec3 c\u00f3 th\u1ec3 chia s\u1ebb to\u00e0n b\u1ed9 h\u1ed3 s\u01a1. N\u1ebfu b\u1ea1n tr\u00ean 13 tu\u1ed5i, h\u00e3y ch\u1eafc r\u1eb1ng b\u1ea1n \u0111\u00e3 nh\u1eadp \u0111\u00fang n\u0103m sinh t\u1ea1i {account_settings_page_link}", 
    "You must sign out and sign back in before your language changes take effect.": "B\u1ea1n c\u1ea7n \u0111\u0103ng xu\u1ea5t v\u00e0 \u0111\u0103ng nh\u1eadp l\u1ea1i \u0111\u1ec3 l\u1ef1a ch\u1ecdn ng\u00f4n ng\u1eef \u0111\u01b0\u1ee3c \u0111\u01b0a v\u00e0o hi\u1ec7u l\u1ef1c.", 
    "You must specify a name for the cohort": "B\u1ea1n ph\u1ea3i \u0111\u1eb7t t\u00ean cho nh\u00f3m.", 
